import React from "react";
import styles from './components/icons/Icon.css'

const IconComponent = ({ path }) => {
    return (
        <button className={`${styles['icon-button']} ${styles['icon-color']}`}>
        <svg>
            <path d={path} />
        </svg>
    </button>
    )
};

export default IconComponent;
